import '../styles/main.css';
import Layout from '../pages/Layout';
import Home from '../pages/home';

import Router from 'next/router'



export default function Index() {
    return (
      <>
      <script>
      window.onload = () =>  document.getElementById('test').click();

      </script>
        <Link href='\Home'>
          <a id="test">Home</a>
        </Link>
        
        </>
    );
  }
